  // \u9ED8\u8BA4\u503C\uFF0C\u7C7B\u578B\u8981\u6C42\u7B26\u5408\u5B57\u6BB5\u7684\u7C7B\u578B\u8981\u6C42
  defaultValue: [],
  // \u662F\u5426\u6A21\u578B\u7684\u4E3B\u952E\uFF0C\u4E00\u4E2A\u6A21\u578B\u6709\u4E14\u53EA\u6709\u4E00\u4E2A\u4E3B\u952E\uFF0C\u5148\u5165\u4E3A\u4E3B
