  // \u662F\u5426\u5B58\u50A8\u6570\u636E\uFF0C\u5982\u679C\u4E0D\u5B58\u50A8\uFF0C\u5B57\u6BB5\u7684\u503C\u8FD8\u662F\u53EF\u4EE5\u8BBF\u95EE\uFF0C\u4F46\u4E0D\u4F1A\u4FDD\u5B58\u5728\u6A21\u578B\u7684store\u4E2D\u3002
